import React from 'react';
import { Menu, Icon, Button, Grid, Container, Form, Input } from 'semantic-ui-react';
import { PropTypes } from 'prop-types';
import { connect } from 'react-redux';
import { changeAgent } from './actions';


function mapStateToProps(state) {
    return {
        AGENT_DD_IDENT: state.authReducer.AGENT_DD_IDENT
    };
}

function mapDispatchToProps(dispatch) {
    return {
        changeAgent: newAgentIdent => dispatch(changeAgent(newAgentIdent)),
    };
}

class AuthComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            AGENT_DD_IDENT: ""
        }
    }


    onSubmit() {

    }

    render() {
        return (
            <Container>
                <Form onSubmit={this.onSubmit}>
                    <Input label="Votre identifiant agent IRIS" default={this.props.AGENT_DD_IDENT}
                        onChange={(event, { value }) => this.setState({ AGENT_DD_IDENT: value })} />
                    <Button> Valider </Button>
                </Form>
            </Container>
        )
    }
}

AuthComponent.propTypes = {
    AGENT_DD_IDENT: PropTypes.string.isRequired
};

export default connect(mapStateToProps, mapDispatchToProps)(AuthComponent);
